import React, {useState} from 'react'

export default function ProjectMembers({user, setMembers}) {
    const [checked, setChecked] = useState(false);
  return (
    <div>
        <div>
            {
                user.pic ? <img src={"http://localhost:5000/profile-pic/" + user.pic} alt="" /> 
                : <div>No image uploaded</div>
            }
            <big>{user.name} </big>
            <big>{user.email} </big>
            <input type="checkbox" value={checked} onClick={(event) => {
                setChecked(!checked)
            }}/>
        </div>
    </div>
  )
}
